import React from 'react';
import {Route, Switch } from 'react-router-dom';
import './App.css';
import {Login} from './Login/Login';
import {Register} from './Register/Register';

function App() {
    return (
        <div className="App">
            <Switch>
                <Route path="/login"
                       render={() => <Login/>}/>
                <Route path="/register"
                       render={() => <Register/>}/>
            </Switch>
        </div>
    );
}

export default App;
